
CREATE TABLE IF NOT EXISTS `prefectures` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(255) NOT NULL COMMENT '都道府県名',
  `order` int(11) NOT NULL COMMENT '表示順',
  `modified` datetime NOT NULL COMMENT '更新日時',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '登録日時',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=48 ;


CREATE TABLE IF NOT EXISTS `cities` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(255) NOT NULL COMMENT '市区町村名',
  `area_id` int(11) NOT NULL COMMENT 'エリアID',
  `order` int(11) NOT NULL COMMENT '表示順',
  `modified` datetime NOT NULL COMMENT '更新日時',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '登録日時',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1936 ;

